import React from "react";
import '../../css/units.css';

const Units = () => {
    return (
        <>
            <div className="units">
                <Row>
                    <div className="unit-header">
                        <h3>Unit 1</h3>
                    </div>
                </Row>
            </div>
        </>
    )
}
export default Units;
